import React from 'react';


function Contact() {
return (
	<div className="contact">
	
	
		<p>&nbsp;</p>
		<p>&nbsp;</p>
		
		<h1>
		Contact Me
		</h1>
		
		
		<p>
				Email: mhorner126@gmail.com or horner.156@osu.edu<br/>
		
			
				Phone: 614-940-2902
			
		</p>
		
		
		
		
		
	</div>
);
}

export default Contact;
